import React,{useState, useEffect} from 'react';


const App = () =>{
  const [videos, setVideos] = useState([]);
  useEffect( () =>{
    const fetchData = async()=>{
      const data = await fetch('https://orangevalleycaa.org/api/videos').then( videos => videos.json());
      setBooks(data);
      }
    fetchData();
  },[])
  return(
    <>
      <div>
        {
          videos.map( video => <div>
            <h1>{video.name}</h1>
            <video height = {200} controls src = {video.video_url}/></div>)
        }
      </div>
    </>
  )
}

export default App;
